import React, { useContext, useEffect, useState } from "react";
import axios from "axios";
import Button from "../button/singleButton";
import Card from "./WalletCard";
import styles from "./CardList.module.scss";
import { storageToken } from "../../contexts/authContext";
import WalletCard from "./WalletCard";

interface Props {
   userWallet?: {};
}

function WalletCardList({ userWallet }: Props) {
   // const [pokemons, setPokemons] = useState<[]>([]);
   // const [nextPage, setNextPage] = useState<String>("");
   // const [previousPage, setPreviousPage] = useState<String>("");
   const [transactions, setTransactions] = useState<
      [
         {
            _id: number;
            type: string;
            pokemonId: number;
            transactionDate: Date;
            monetaryValue: number;
            BTCCurrencyAtTrade: string;
         }
      ]
   >();

   const token = storageToken();

   useEffect(() => {
      (async function () {
         await axios
            .get("http://localhost:3000/transactions", {
               headers: {
                  ["x-access-token"]: token,
               },
            })
            .then((res) => {
               setTransactions(res.data);
            });
      })();
   }, []);

   return (
      <div className={styles.container}>
         <ul className={styles.cardList}>
            {transactions
               ?.filter((transaction) => transaction?.type === "buy")
               ?.map((buyTransaction) => {
                  console.log(buyTransaction, "BUy");
                  console.log(buyTransaction.monetaryValue, "monetaryValue");
                  return (
                     <WalletCard
                        pokemonId={buyTransaction?.pokemonId}
                        transactionDate={buyTransaction.transactionDate}
                        BTCCurrencyAtTrade={buyTransaction?.BTCCurrencyAtTrade}
                        monetaryValue={buyTransaction?.monetaryValue}
                     />
                  );
               })}
         </ul>
         <div className={styles.navigationPagesContainer}>
            <Button type="button">Página Anterior</Button>
            <Button type="button">Próxima Página</Button>
         </div>
      </div>
   );
}

export default WalletCardList;
